    \begin{tikzpicture}
    % Octagon
    \draw[thick] (0,1) -- (1,2) -- (2,2) -- (3,1) -- (3,0) -- (2,-1) -- (1,-1) -- (0,0) -- cycle;
    \foreach \x/\y in {0/1, 1/2, 2/2, 3/1, 3/0, 2/-1, 1/-1, 0/0} {
        \fill[black] (\x,\y) circle (2pt);
    }
    \foreach \x/\y in {0.5/1, 1.5/2, 2.5/1, 3/0.5, 2.5/0, 1.5/-1, 0.5/-1, 0/0.5} {
        \fill[red] (\x,\y) circle (2pt);
    }
    \fill[green] (1.5,0.5) circle (2pt);

    % Square
    \draw[thick] (5,0) rectangle (7,2);
    \foreach \x/\y in {5/0, 7/0, 7/2, 5/2} {
        \fill[black] (\x,\y) circle (2pt);
    }
    \foreach \x in {6} {
        \fill[red] (\x,0) circle (2pt);
        \fill[red] (\x,2) circle (2pt);
    }
    \foreach \y in {1} {
        \fill[red] (5,\y) circle (2pt);
        \fill[red] (7,\y) circle (2pt);
    }
    \fill[green] (6,1) circle (2pt);

    % Connect vertices
    \foreach \x/\y in {0/1, 1/2, 2/2, 3/1, 3/0, 2/-1, 1/-1, 0/0} {
        \foreach \a/\b in {5/0, 7/0, 7/2, 5/2} {
            \draw[black] (\x,\y) -- (\a,\b);
        }
    }
\end{tikzpicture}
    \end{document}

