\documentclass[tikz,border=10pt]{standalone}
    \usepackage{tikz}
    \usetikzlibrary{arrows.meta, positioning, shapes.geometric}

    \begin{document}
    \begin{tikzpicture}
    % Define the number of owners and items
    \def\M{5} % Number of owners
    \def\N{5} % Number of items for the first M owners
    \def\L{3} % Number of additional owners

    % Draw brackets for owners 1 to M
    \foreach \i in {1,...,\M} {
        \draw[decorate, decoration={brace, amplitude=10pt}] (0,\i) -- (\N,\i) node[midway,xshift=10pt] {Owner \i};
    }

    % Draw brackets for owner M+1
    \draw[decorate, decoration={brace, amplitude=10pt}] (0,\M+1) -- (3,\M+1) node[midway,xshift=10pt] {Owner \M+1};

    % Draw brackets for owners M+2 to M+L
    \foreach \j in {2,...,\L} {
        \pgfmathsetmacro{\items}{\N*(1 - (1/\M)^{\j-1}) + 1}
        \draw[decorate, decoration={brace, amplitude=10pt}] (0,\M+\j) -- (\items,\M+\j) node[midway,xshift=10pt] {Owner \M+\j};
    }

    % Set the y-axis limits
    \foreach \k in {0,...,\M+\L} {
        \draw (-0.5,\k) -- (0,\k);
    }
\end{tikzpicture}
    \end{document}

