    % Draw the black bar
    \fill[black] (0,-0.5) rectangle (10,0);

    % Draw the bars
    \foreach \i in {0,1,2,3,4,5,6,7,8} {
        \pgfmathsetmacro{\height}{1 + \i*0.4} % Different heights
        \pgfmathsetmacro{\width}{0.5} % Width for the normal bars
        \pgfmathsetmacro{\xpos}{1 + \i*1.0} % X position for spacing

        % Draw the first (wider) bar
        \ifnum\i=0
            \fill[gray] (\xpos-0.25,0) rectangle (\xpos+0.25,\height);
            \fill[yellow] (\xpos-0.2,0) rectangle (\xpos+0.2,\height-0.1);
        \else
            % Draw the remaining bars
            \fill[gray] (\xpos-0.25,0) rectangle (\xpos+0.25,\height);
            \fill[yellow] (\xpos-0.2,0) rectangle (\xpos+0.2,\height-0.1);
        \fi
    }
\end{tikzpicture}
    \end{document}

