        \draw[thick] (\x, 2) -- (\x, 0);
        \node at (\x, 0) {\x};
    }
    \draw[thick] (5,2) -- (5,0);
    \foreach \y in {1, 2, 3, 4} {
        \node at (6, 2 - 0.5*\y) {$n - 2*\y$};
    }

    % Arrow to step 2
    \draw[->, thick] (2.5, 1.8) -- (2.5, 1.5);

    % Step 2
    \draw[thick] (0,0) -- (5,0);
    \foreach \x in {1, 2, 3, 4} {
        \draw[thick] (\x, 0) -- (\x, -2);
    }
    \foreach \y in {1, 2, 3} {
        \node at (0, -0.5*\y) {$n - 6 + 2*\y$};
    }
    \draw[thick] (5,0) -- (5,-2);
    \draw[thick] (0, -2) -- (5, -2);
    \foreach \x in {1, 2, 3, 4} {
        \draw[thick] (\x, -2) -- (\x, -4);
    }
