    \begin{tikzpicture}
    % Define the nodes
    \foreach \i in {0,...,8} {
        \node[circle, draw=black, fill=black, minimum size=10pt] (top\i) at (\i, 2) {\i};
        \node[circle, draw=red, fill=red, minimum size=5pt] (mid\i) at (\i, 1) {};
        \node[circle, draw=blue, fill=blue, minimum size=5pt] (bot\i) at (\i, 0) {};
    }

    % Draw edges in the top row
    \foreach \i in {0,...,7} {
        \draw[black] (top\i) -- (top\i+1);
    }

    % Draw edges between top row and middle row
    \foreach \i in {0,...,8} {
        \draw[red] (mid\i) -- (top\i);
        \draw[red] (mid\i) -- (top\i+1);
    }

    % Draw edges between middle row and bottom row
    \foreach \i in {0,...,8} {
        \draw[blue] (bot\i) -- (mid\i);
        \draw[blue] (bot\i) -- (mid\i-1);
        \draw[blue] (bot\i) -- (mid\i+1);
    }

    % Draw curved edges between top row and bottom row
    \foreach \i in {0,...,8} {
        \draw[black, bend right=20] (top\i) to (bot\i);
        \draw[black, bend left=20] (top\i) to (bot\i);
    }
\end{tikzpicture}
    \end{document}

